<a class="anchor" name="585855f64c88e2f2c3b272cc1812fe67"></a><!-- doxytag: member="OPI::PropertyHandle::AddInstance" ref="585855f64c88e2f2c3b272cc1812fe67" args="(PropertyHandle *prophdl)" --><p>
<table class="mdTable" cellpadding="2" cellspacing="0">
  <tr>
    <td class="mdRow">
      <table cellpadding="0" cellspacing="0" border="0">
        <tr>
          <td class="md" nowrap valign="top">bool OPI::PropertyHandle::AddInstance           </td>
          <td class="md" valign="top">(&nbsp;</td>
          <td class="md" nowrap valign="top"><a class="el" href="classOPI_1_1PropertyHandle.php">PropertyHandle</a> *&nbsp;</td>
          <td class="mdname1" valign="top" nowrap> <em>prophdl</em>          </td>
          <td class="md" valign="top">&nbsp;)&nbsp;</td>
          <td class="md" nowrap><code> [private]</code></td>
        </tr>
      </table>
    </td>
  </tr>
</table>
<table cellspacing="5" cellpadding="0" border="0">
  <tr>
    <td>
      &nbsp;
    </td>
    <td>

<p>
Add instance by property value. 
<p>
The function checks whether the property handle passes a numerical value or not. When passing a numerical value the function creates an instance at the position according to the number passed in the property handle (-&gt; "Create instance at position"). Otherwise the value in the property handle is interpreted as string key, which will be converted into key and adds an instance by key value to the collection (-&gt; "Add instance by key value")..     </td>
  </tr>
</table>
<a class="anchor" name="e368d900403a7d8bd8e64b8b969b9384"></a><!-- doxytag: member="OPI::PropertyHandle::AddOnPosition" ref="e368d900403a7d8bd8e64b8b969b9384" args="(int setpos0w, bool initinst)" --><p>
<table class="mdTable" cellpadding="2" cellspacing="0">
  <tr>
    <td class="mdRow">
      <table cellpadding="0" cellspacing="0" border="0">
        <tr>
          <td class="md" nowrap valign="top">bool OPI::PropertyHandle::AddOnPosition           </td>
          <td class="md" valign="top">(&nbsp;</td>
          <td class="md" nowrap valign="top">int&nbsp;</td>
          <td class="mdname" nowrap> <em>setpos0w</em>, </td>
        </tr>
        <tr>
          <td class="md" nowrap align="right"></td>
          <td class="md"></td>
          <td class="md" nowrap>bool&nbsp;</td>
          <td class="mdname" nowrap> <em>initinst</em></td>
        </tr>
        <tr>
          <td class="md"></td>
          <td class="md">)&nbsp;</td>
          <td class="md" colspan="2"><code> [private]</code></td>
        </tr>
      </table>
    </td>
  </tr>
</table>
<table cellspacing="5" cellpadding="0" border="0">
  <tr>
    <td>
      &nbsp;
    </td>
    <td>

<p>
Create instance at position. 
<p>
This function is used to create an instance at a certain position in an unordered collection. The function creates the instance at the passed position (set_pos_w). When AUTO is passed the instance is created infront of the selected instance. When no instance is selected the new instance is appended to the end of the collection. The instance in the property handle can be initialized before calling the Add function calling <a class="el" href="classOPI_1_1PropertyHandle.php#bf6163044e2c160b24c4314460304aac">GetInitInstance()</a> and setting initial property values. In this case the init_inst option must be set to YES when calling the function (otherwuise the initialized instance will be ignored) and the function operates similar to the "Add instance at position" function. The instance can be also initialized before adding to the collection using the DBInitialized event in the structure context. When the collection is ordered the position passed will be ignored and the instance will be inserted in the collection according to the key passed within the initialized instance. When the instance is not initialized, the instance is created with the default values defined in the data model (structure definition).     </td>
  </tr>
</table>
