    </td>
  </tr>
</table>
<table cellspacing="5" cellpadding="0" border="0">
  <tr>
    <td>
      &nbsp;
    </td>
    <td>

<p>
Copy instance data from source instance. 
<p>
The implementation copies the data from the source instance into the target instance. All direct properties (attributes and base structures) are copied by name. References and relationships are copied, when not yet existing or when replace opt REPL_local (for references) or REPL_all (for references and relationships) has been defined. When the target is sorted, the sort key is not copied from the source. When the target is not sorted, but an ident-key is defined for the structure, the ident-key remains unchanged. The target instance will not be initialized, i.e. fields not existing in the source instance are not changed.     </td>
  </tr>
</table>
