        </tr>
      </table>
    </td>
  </tr>
</table>
<table cellspacing="5" cellpadding="0" border="0">
  <tr>
    <td>
      &nbsp;
    </td>
    <td>

<p>
Get instance by value in the property handle. 
<p>
When passing the value for locating an instance in a collection via property hanndle, <a class="el" href="classOPI_1_1PropertyHandle.php#020f14afc5c582f3503e74271176309f">Get()</a> is called as get by key or index depending on the data type defined in the property handle. When the value property handle passes a structured instance of the same or a specialized type as the instance to be selected, the key value is extracted from the instance passed in the property handle and get by key is used. When passing a text value (STRING, MEMO or CHAR), the text data is considered as string key where key komponents are separated by |. You cannot pass a structured key (Key) my means of property handles. If not the key or instant version is used the 'get by position' version is called. Non-integer numerical values are rounded to the next lower integer number.     </td>
  </tr>
</table>
