<a class="anchor" name="9695d331b2c7583a1aa4ef5686ae79d8"></a><!-- doxytag: member="OPI::PropertyHandle::GetAtPosition" ref="9695d331b2c7583a1aa4ef5686ae79d8" args="(int setpos0w)" --><p>
<table class="mdTable" cellpadding="2" cellspacing="0">
  <tr>
    <td class="mdRow">
      <table cellpadding="0" cellspacing="0" border="0">
        <tr>
          <td class="md" nowrap valign="top">bool OPI::PropertyHandle::GetAtPosition           </td>
          <td class="md" valign="top">(&nbsp;</td>
          <td class="md" nowrap valign="top">int&nbsp;</td>
          <td class="mdname1" valign="top" nowrap> <em>setpos0w</em>          </td>
          <td class="md" valign="top">&nbsp;)&nbsp;</td>
          <td class="md" nowrap><code> [private]</code></td>
        </tr>
      </table>
    </td>
  </tr>
</table>
<table cellspacing="5" cellpadding="0" border="0">
  <tr>
    <td>
      &nbsp;
    </td>
    <td>

<p>
Get Instance by index position. 
<p>
Reading an instance by position is locating the instance on the given location in the selected index (sort order). Thus, the result will change usually when changing the selected index for the collection. Using index positions for reading is also a weak point when indexes are updated simultaneously, since the index position might change when other users insert or remove entries from the index. To avoid this you may use the <a class="el" href="classOPI_1_1PropertyHandle.php#06cb7fc442ff07c7e48b2a4034aa6868">LockSet()</a> function, that locks the complete collection. Access by position, however, is a comfortable way browsing through a collection. Access by position cannot be used for LOID or GUID property handles. Passing a number to an LOID handle interpretes the number as local object identity. For a path property <a class="el" href="classOPI_1_1PropertyHandle.php#020f14afc5c582f3503e74271176309f">Get()</a> by position automatically changes the selection for higher properties in the path when the end of collection is signaled an a level that is not the top level for the path property. Passing AUTO as position the function returns the instance currently selected in the property handle. When no instance is selected the function returns the first instance in the collection. When an instance is selected in the property handle and the current access mode does not correspond to the required access mode, the function will re-read the instance. Thus, the function can be used to update the access mode when the selected instance was write protected. Selections in subordinated property handles are canceled when re-reading the instance.     </td>
  </tr>
</table>
