<table cellspacing="5" cellpadding="0" border="0">
  <tr>
    <td>
      &nbsp;
    </td>
    <td>

<p>
Get instance by key value. 
<p>
When reading an instance by key, this is considered as key in the currently selected index (<a class="el" href="classOPI_1_1PropertyHandle.php#36781851115bcf6759b4504260604573">SetOrder()</a>). When the key cannor be found in the index the function returns an empty instance. It is also possible to locate an instance by key in an unordered collection, when it has been marked as unique (no duplicate instances). In this case the key must be passed according to the structure of the ident key. The key must be passed according to the internal key structure. The key can also be an LOID or a GUID string when the property handle has been opened for reading by local object identities (__LOID) or by global unique identifiers (__GUID). When positioning the instance for a path property the key must consist of all sort keys along the path.     </td>
  </tr>
</table>
